Halloween H20: Twenty Years Later
.
Director: Steve Miner 
Date of Release: August 5th, 1998
Official Rating: 7.5/10
.
Jamie Lee Curtis as Laurie Strode 
Michelle Williams as Molly Cartwell 
Josh Hartnett as John Strode 
LL Cool J as Ronny Jones
& Adam Arkin as Will Brennan
.
Scarred and haunted by the tragic events in her past and having gone into hiding, Laurie Strode must once again conquer her fears as Michael Myers continues his sinister reign of terror on October the 31st.
.
Cloaked under a cinematic sorbet of nostalgia and enhanced by compelling performances along with a star studded cast that includes the legendary and late Janet Leigh as Norma, Steve Miner's late twentieth century blockbuster hit and theatrical slasher sequel entitled Halloween H20: Twenty Years Later ultimately returns Scream Queen Jamie Lee Curtis to one of her most notable roles, Laurie Strode.
.
Long time and passionate fans of the Horror franchise, that came round full circle in the summer of 2002 with Resurrection, are suited up for a trick or treat experience as this contemporary follow up brings the juggernaut of the genre, the infamous and sinister Shape, back in style while wielding enough gravitas to sincerely declare this one heck of a worthy installment.
.
Granted there are ingredients that do not always strike the correct chord such as the distracting swapping out of masks worn by our antagonist and boasting too short a run time; that said, these aforementioned obstacles are outclassed by suspenseful sequences centered and cemented around tension and terror.
.
& In conclusion; championed by an effective score composed by Marco Beltrami and showcasing a satisfyingly shocking twist ending, Steve Miner's Halloween H20: Twenty Years Later (1998) delivers.
.
